import React from 'react';

function Stats({ specs }) {
    // Render the specs in the way you want
    // For example, if specs is an array of objects with a 'name' property
    return (
        <div>
            {specs.map((spec, index) => (
                <p key={index}>{spec.name}</p>
            ))}
        </div>
    );
}

export default Stats;
